import React from 'react'
import { Link } from 'react-router-dom'

export const Home = () => {
  return (
    <div>
    <div ><img style={{width:'880px'}} src='cart-list\src\image\banner-3.jpg'></img></div>
    <div ><Link to={'/products'}><button className='btn btn-outline-secondary btn-lg'>Start Shopping</button></Link></div>
    </div>
  )
}
